import React from 'react';
import {forum} from '../data/Threads'
import { NavLink } from 'react-router-dom';

function Forum() {
    return(
        <div className="forum">
            {forum.map((thread, index) => (
                <NavLink className='thread' to={"/"+thread.id} exact>{thread.title}</NavLink>
            ))}
        </div>
    );
};

export default Forum;
